import './Auction.css';
import Product from './Product';
import { useState, useEffect } from "react";
import Bid from './Bid';


function Auction() {
    const [posts, setPosts] = useState([]);
    let headers = new Headers();
    headers.append('Origin', 'http://localhost:3001/');
    useEffect(() => {
        const fetchProducts = () => {
            fetch('http://localhost:5001/api/v1/showBids/9a4449ec-b15a-4ca8-806a-f4d1bbb6375f', {
                method: 'GET'
            })
                .then((response) => response.json())
                .then((data) => {
                    setPosts(data);
                    console.log(posts.product.productName);
                })
                .catch((err) => {
                    console.log(err.message);
                });
        };
        fetchProducts();
    }, []);

    return (
        <div>
            <Product
                productName={posts.product.productName}
                shortDescription={posts.product.shortDescription}
                startPrice={posts.product.startPrice}></Product>
            <Bid
                firstName={posts.bids}></Bid>
        </div>

    );
}

export default Auction;
